import { useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';



function Register2() {

    const [nombre, setNombre] = useState('');
    const [correo, setCorreo] = useState('');
    const [pssw, setPssw] = useState('');

    const enviarDatos = () =>{
        axios.post("http://localhost:3001/register",{

            name: nombre,
            email: correo,
            pssw: pssw

        }
        ).then(
            (resp)=>{
                if(resp.data.message === "Error"){
                    alert("Error al registrarse");
                }else if(resp.data.message === "Registrado"){
                    console.log(resp)
                    alert("Se ha registrado correctamente");
                }
            }
        )
    }

    return (  
        <>
            <section>
                
                <form>

                    <div class="uno">
                        <h2>Regístrate en Pokemón Training Zone</h2>

                        <label for="profile-pic" class="profile-label">Foto de perfil:</label>
                        <input type="file" id="profile-pic" accept="image/jpeg, image/png" onchange="loadFile(event)"/>
                        <img id="output" class="profile-pic"/>

                        <label for="name">Nombre:</label>
                        <input type="text" id="name" placeholder="Ingresa tu nombre" required/>
                    </div>
                    
                    <div class="dos">
                        <label for="email">Correo Electrónico:</label>
                        <input type="email" id="email" placeholder="Ingresa tu correo" required/>

                        <label for="usuario">Usuario</label>
                        <input type="text" id="usuario" placeholder="Crea tu usuario" required/>
                        
                        <label for="gender">Género:</label>
                        <select id="gender" required>
                            <option value="">Selecciona una opción</option>
                            <option value="niño">Niño</option>
                            <option value="niña">Niña</option>
                        </select>
                        
                        <label for="birth">Fecha de Nacimiento:</label>
                        <input type="date" id="birth" required/>
                        
                        <label for="password">Contraseña:</label>
                        <input type="password" id="password" placeholder="Crea una contraseña" required/>

                        <button type="submit">Crear Cuenta</button>
                    </div>
                    
                </form>
                
            </section>
            
            <section class="footer">
                <Link to="/Login" className='btn btn-outline-info'>¿Tienes cuenta? Iniciar sesión</Link>
            </section>
        </>
    );
}

export default Register2;
